from math import sqrt
from collections import Counter

# Function to calculate the Euclidean distance
def euclidean_distance(p1, p2):
    return sqrt((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2)

# Recursive function for finding closest pair
def closest_pair_recursive(pts):
    n = len(pts)
    if n <= 3:  # Directly calculate distances for small number of points
        min_distance = float('inf')
        closest = (None, None)
        for i in range(n):
            for j in range(i + 1, n):
                dist = euclidean_distance(pts[i], pts[j])
                if dist < min_distance:
                    min_distance = dist
                    closest = (pts[i], pts[j])
        return closest, min_distance
        
    mid = n // 2
    left_pair, left_distance = closest_pair_recursive(pts[:mid])
    right_pair, right_distance = closest_pair_recursive(pts[mid:])
        
    min_distance = min(left_distance, right_distance)
    closest = left_pair if left_distance < right_distance else right_pair
        
    mid_x = pts[mid][0]
    strip = [p for p in pts if abs(p[0] - mid_x) < min_distance]
    #print (strip)

    strip.sort(key=lambda p: p[1])

    # Check distances within the strip
    for i in range(len(strip)):
        for j in range(i + 1, min(i + 7, len(strip))):
            dist = euclidean_distance(strip[i], strip[j])
            if dist < min_distance:
                min_distance = dist
                closest = (strip[i], strip[j])

    return closest, min_distance

def closest_pair(points):

    elements = Counter(points)
    if elements.most_common(1)[0][1] > 1:
        most_common = elements.most_common(1)[0][0]
        return (most_common, most_common)

    # Sort points by the x-coordinate
    points = sorted(points, key=lambda p: p[0])
    

    result, _ = closest_pair_recursive(points)
    print (result)
    return result
    
    
